var Plugins={add:function(b){var a='<div class="plugin-wrapper" id="'+b.id+'"><div class="plugin" style="background-image:url('+b.icon+');"><div class="plugin-details"><div class="plugin-header"><span class="plugin-title">'+b.title+'</span><span class="plugin-version">'+b.version+'</span></div><div class="desc-description">'+b.desc+'</div></div><div class="plugin-controls"><div class="checkbox enable-checkbox"><label><input type="checkbox"> <span class="enable-checkbox-text"><span class="enabled-text" data-tr="enabled">'+Plugins.tr("enabled")+'</span><span class="enable-text" data-tr="enable">'+Plugins.tr("enable")+"</span></span></label></div></div></div></div>";$("#plugins-list").append(a);Plugins.enable(b.id,b.enabled);$("#"+b.id+" input:checkbox").click(function(){Plugins.enable(b.id,$("#"+b.id+" input:checkbox").prop("checked"))})},enable:function(b,a){if(a){$("#"+b+" input:checkbox").attr("checked","checked");$("#"+b).addClass("plugin-enabled");$("#"+b+" .enabled-text").show();$("#"+b+" .enable-text").hide()}else{$("#"+b+" input:checkbox").removeAttr("checked");$("#"+b).removeClass("plugin-enabled");$("#"+b+" .enabled-text").hide();$("#"+b+" .enable-text").show()}},retranslate:function(){$("[data-tr]").each(function(){Plugins.TR($(this).attr("data-tr"))})},tr:function(a){return SimpleChat.translate(a)},TR:function(a){$("[data-tr='"+a+"']").html(Plugins.tr(a))}};$(document).ready(function(){var a=PluginsView.list();for(var b=0;b<a.length;b++){Plugins.add(a[b])}});if(typeof PluginsView==="undefined"){PluginsView={list:function(){return[]}}}else{SimpleChat.retranslated.connect(Plugins.retranslate)};